import react from 'react';
import { useSelector } from 'react-redux';

const Loading = () => {

    const loading = useSelector(state => state.app.Loading);

    return loading && (
        <div class="center">
            <div class="legend">Rates are updating...</div>
        </div>
    )
}

export default Loading;
